2	t	f	f	f	f	2012-12-31 04:21:53.661+00	2015-10-11 10:06:05.813+00	system_generated	system_generated	t	active	f3d51eba-5376-11e2-9cfb-22000a1e8c2c	Membership Benefits	membership-benefits	<p>It is important to communicate with prospective members the benefits of becoming a member of your Association. Your website is a great place to showcase the benefits of membership to recruit new members and help member retention of your existing group.</p>\r\n<p><strong>Sample membership benefits you may want to include:</strong></p>\r\n<ul>\r\n<li>Free or discounted admission to Events such as monthly luncheons, professional development seminars, and networking events.</li>\r\n<li>Free or discounted Job Board pricing to add or view Job Listings and Resumes.</li>\r\n<li>Listing in your Association's online Business Directory.</li>\r\n<li>Exclusive member-only content such as articles, pages, or videos. For any piece of content within Tendenci, you can define the permissions so that only certain User Groups or Membership Levels have access to that information as an added benefit.</li>\r\n<li>Ability to add content such as Events and Job Listings to the website. The workflow settings can be configured to require admin approval as well before content is made public.</li>\r\n</ul>\r\n<p><strong><a href="/memberships/applications/add/">Fill out our membership application to become a member!</a></strong></p>	f		t	default.html	cause,results,nonprofit	1		\N	1	1	\N	\N	1
4	t	f	f	f	f	2012-12-31 05:31:17.977+00	2015-11-13 04:58:02.657+00	system_generated	system_generated	t	active	a5f5454e-5380-11e2-a2e2-22000a1e8c2c	How to Use Your Theme	how-to-use-your-theme	<p>This theme is intended to fit the needs of most associations.</p>\r\n<p><strong>REMINDER</strong>: To edit and work on the site you will need proper permissions. So, make sure you are logged in to see all the site has to offer: <a href="/login">/login</a></p>\r\n<p><strong>Check for upcoming trainings at <a title="Upcoming Trianings" href="https://www.tendenci.com/events/search/" target="_blank">https://www.tendenci.com/events/search/</a></strong></p>\r\n<p>Here are a few highlights:</p>\r\n<ol>\r\n<li><strong>Stories</strong> are used for the main home page rotator as well as rotating sponsors in the sidebar. You can see the stories located here: <a href="/stories/">/stories/</a>. By using "tags" you can determine where a story is visible. For example, stories tagged "<a href="/stories/?q=tag:rotator">rotator</a>" will be featured on the home page rotator, and stories tagged "<a href="/stories/?q=tag:sponsors">sponsors</a>" will be visible in the sidebar sponsor area.<br /><br /></li>\r\n<li><strong>Boxes</strong> are used as content areas on the home page. You can see all of the boxes used on the site here: <a href="/admin/boxes/box/">/admin/boxes/box/</a> In addition if you "roll over" a box on the home page an edit box will appear at the top. This will allow you direct access to change the text.<br /><br /></li>\r\n<li><strong>Events</strong> are ususally the most used feature of an association website. The home page features both a list of upcoming events and also a box that will show the next event chronologically. Simply add events to the calendar and they will appear on the list with the most recent showing first. Here is the overall event calendar: <a href="/events/month/">/events/month/</a><br /><br /></li>\r\n<li><strong>News</strong> is a list on the home page of news items in reverse chronological order posted. You can search and see the full list of news here: <a href="/news/">/news/</a> Simply add news items and watch them show on the list. <a href="/news/add/">/news/add/</a><br /><br /></li>\r\n<li><strong>Business Directories</strong> are a great way to list sponsors, partners, paid buisness listings or other associations. You can add business directories here: <a href="/directories/add/">/directories/add/</a> The business directory logos will be dynamically shown on the home page in the carousel just above the footer.<br /><br /></li>\r\n<li><strong>Job Listings</strong> are a fantastic way for associations to make money. The home page featues a dynamic listing of open positions. Simply add jobs to the job board and the listing will show on the job board and most recent added will show on the home page. To add jobs click here: <a href="/jobs/add/">/jobs/add/</a><br /><br /></li>\r\n<li><strong>Rich Media</strong>, your association can't live without it. You can add photos and videos to your site and they will feed dynamically to the home page. To add photos go to the photo albums: <a href="/photos/set/latest/">/photos/set/latest/</a> To add videos use the video module (you will need to use YouTube or Vimeo videos): <a href="/videos/">/videos/</a><br /><br /></li>\r\n<li><strong>Editing your Navigation</strong> is pretty easy. You can find the navigation here: <a href="/navs/">/navs/</a> or just click edit on the link that appears when you are using the navigation.</li>\r\n</ol><hr />\r\n<p style="text-align: center;"><strong>&nbsp;</strong></p>\r\n<p style="text-align: center;"><em><strong>Have questions? Interested in packages to build out your site?:</strong></em></p>\r\n<h3 style="text-align: center;"><strong><a title="Contact Form" href="https://www.tendenci.com/contact/" target="_blank">Contact the Tendenci Team</a></strong></h3>\r\n<p><strong>&nbsp;</strong></p>\r\n<h3>&nbsp;</h3>	f		f	default.html	demo	1		\N	1	1	\N	\N	1
