9	t	f	f	f	f	2015-08-31 09:10:22.52+00	2015-11-13 04:59:21.584+00	system_generated	system_generated	t	active	12e18e1e-502d-11e5-aebb-0242ac110051	Here are some helpful tips for getting started!	getting-started	<p><strong><strong>REMINDER</strong>: To edit and work on the site you will need proper permissions.&nbsp;</strong><strong>So, make sure you are logged in to see all the site has to offer:&nbsp;<span style="color: #2ac0d4;"><a href="/login"><span style="color: #2ac0d4;">/login</span></a></span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #000000;"><strong>Check <a title="Tendenci Trainings" href="https://www.tendenci.com/events/search/" target="_blank">https://www.tendenci.com/events/search/</a> for upcoming trainings!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<div class="t-pages-page-body"><ol><ol>\r\n<li><strong><strong>Get oriented with an introduction to your administrator menu.<br /></strong></strong><iframe height="315" src="https://www.youtube.com/embed/ge0aNH2G45I" width="560"></iframe><br /><a href="https://www.youtube.com/watch?v=ge0aNH2G45I&amp;feature=youtu.be" target="_blank">https://www.youtube.com/watch?v=ge0aNH2G45I&amp;feature=youtu.be</a><br /><br /></li>\r\n<li><strong><strong><span class="il">Play</span>&nbsp;<span class="il">I&nbsp;</span>SPY!<br /></strong></strong>\r\n<p>&nbsp;</p>\r\nScroll through your homepage and look for "Edit ....... Box" Links. Click on these &nbsp;"Edit ...Box" links to edit parts of your homepage content.<br /><br /><img title="42.png" src="/files/41/" alt="42.png" width="343" height="93" /></li>\r\n<li><strong>Tell the world who you are!<br /></strong>Click on the Mission/Vision page in the navigation under the About Tab<br /><img title="43.png" src="/files/42/" alt="43.png" width="400" height="221.32796780684106" /><br />Scroll to the bottom and click "Edit" to update the content on the page.&nbsp;</li>\r\n</ol></ol><img title="45.png" src="/files/43/" alt="45.png" width="383" height="117" /></div>\r\n<div class="t-pages-page-body">&nbsp;</div>\r\n<div class="t-pages-page-body">&nbsp;<strong>Check out these helpful modules:</strong><br /><ol><ol>\r\n<li>-&nbsp;<a title="/stories/" href="Stories" target="_blank">Stories : Click here to update your homepage rotator images and text </a>&nbsp;(<span style="color: #2ac0d4;"><a title="Stories Helpfile" href="https://www.tendenci.com/help-files/how-do-i-use-the-stories-module/" target="_blank"><span style="color: #2ac0d4;">Helpfile</span></a></span>)<br />- <a title="News" href="/news/" target="_blank">News :&nbsp; Click here to add items to your homepage News Feed</a> (<span style="color: #2ac0d4;"><a title="News Helpfile" href="https://www.tendenci.com/help-files/add-edit-news/" target="_blank"><span style="color: #2ac0d4;">Helpfile</span></a></span>)<br />- <a title="Events" href="/events/search/" target="_blank">Events : Click here to add events to your calendar</a> (<span style="color: #2ac0d4;"><a title="Help File Events" href="/help-files/adding-new-events-and-event-types-your-events-calendar/" target="_self"><span style="color: #2ac0d4;">Helpfile</span></a></span>)<br />- <a title="Membership" href="/profiles/search/?member_only=on" target="_blank">Memberships : Click here to set up automatic management of membership join/renewal</a> (<span style="color: #2ac0d4;"><a title="Intro to Memberships" href="/help-files/intro-memberships/" target="_blank"><span style="color: #2ac0d4;">Helpfiles</span></a></span>) <br />- <a href="/profiles/search/?member_only=on" target="_blank">Business Directories : Click here to list sponsors, partners, paid buisness listings or other associations.</a>&nbsp;(<span style="color: #2ac0d4;"><a title="Directories" href="help-files/directories-module-settings/" target="_blank"><span style="color: #2ac0d4;">Helpfile</span></a></span>&nbsp;)<br /> - <a href="/admin/navs/nav/1/" target="_blank">Navigation: Click here to dynamically edit your navigation </a>&nbsp;(<span style="color: #2ac0d4;"><a title="Intro to Memberships" href="/help-files/how-to-edit-your-navigation/" target="_blank"><span style="color: #2ac0d4;">Helpfiles</span></a></span>)</li>\r\n</ol></ol><strong>Get inspired!</strong><br /><ol><ol>See how different people in our Tendenci community have used our software to forward their mission!</ol></ol><br /><a href="http://www.ymcahouston.org/" target="_blank"><span style="color: #2ac0d4;">www.ymcahouston.org</span></a><br /><a href="http://www.sfbig.org/" target="_blank"><span style="color: #2ac0d4;">www.sfbig.org</span></a><br /><a href="http://www.nyemmys.org" target="_blank"><span style="color: #2ac0d4;">www.nyemmys.org</span></a>\r\n<p>&nbsp;</p>\r\n</div>\r\n<hr />\r\n<p style="text-align: center;"><em><strong>Have questions? Interested in packages to build out your site?:</strong></em></p>\r\n<h3 style="text-align: center;"><strong><a title="Contact Form" href="https://www.tendenci.com/contact/" target="_blank">Contact the Tendenci Team</a></strong></h3>\r\n<p><strong>&nbsp;</strong></p>\r\n<h3>&nbsp;</h3>	f		t	default.html		1		1	\N	1	\N	\N	1
