16	t	f	f	f	f	2016-04-14 03:34:32.298+00	2018-03-19 04:53:35.751194+00	system_generated	chendong	t	active	c42f1e50-025e-11e6-aebb-0242ac11000c	Renewal	renewal	<div class="t-pages-page-body">\r\n<p>Thank you for your continued participation in our organization!</p>\r\n<p>You may have received an email from us with a link to renew your membership.</p>\r\n<p>If you haven't received a renewal email, please follow the directions below to renew your membership.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Individual Members<br /></strong></p>\r\n<p>1. Log into the website at www.myurl.com/login</p>\r\n<p>2. If you are eligible to renew your membership, you will automatically be taken to your profile on login and will see a link to renew your membership as pictured below.</p>\r\n<p><img title="2016-04-04_1328.png" src="http://gra.tendenci.net/files/102/" alt="2016-04-04_1328.png" width="293" height="79" /></p>\r\n<p>3. Click "Renew your membership now" and fill out the resulting form to renew your membership.</p>\r\n<h4>&nbsp;</h4>\r\n<h4><strong>Corporate/Group Membership:</strong></h4>\r\n<p>If you are responsible for a corporate/group membership, please follow the instructions below to renew.</p>\r\n<p>1. Log into the website at www.myurl.com/login</p>\r\n<p>2. Navigate to your corporate membership in the dropdown bar at the top of the page.</p>\r\n<p><img title="mycorporatemembership.png" src="http://gra.tendenci.net/files/112/" alt="mycorporatemembership.png" width="269" height="220" /></p>\r\n<p>3. After you click the link "My Corp. Memb.", if you are eligible to renew your corporate/organizational membership, you will see a link to renew.</p>\r\n<p>&nbsp;</p>\r\n<p><img title="corpmembershiprenewal.png" src="http://gra.tendenci.net/files/105/" alt="corpmembershiprenewal.png" width="400" height="83.50634371395617" /></p>\r\n<p>&nbsp;</p>\r\n<p>Please note that only your "Corporate Member Representitive" or "Billing Representative" will have access to renew your membership. Individuals who are part of the corporate membership but not designated as the "Corporate Member Representitive" or "Billing Representative" will not have access to renew.</p>\r\n<p><img title="Corp_Membership_Renewal.png" src="//cdn.ams365.cn/kunshanfa_dev/media/files/files/8950c0d9/2015-09-10-064930.jpg" alt="Corp_Membership_Renewal.png" width="400" height="170.0502512562814" /></p>\r\n<p>&nbsp;</p>\r\n<p>At the time of renewal you can choose to renew all individuals who are part of your corporate membership.</p>\r\n<p>If you have any trouble with membership renewal or need access to be set up as a representative for your corporate/group membership, please <a href="http://gra.tendenci.net/contact" target="_blank" rel="noopener">contact us</a></p>\r\n<p>&nbsp;</p>\r\n</div>	f		t	default.html		1		\N	\N	1	\N	2	2
