36	dateformat	Date Format	<a href='#id_dateformat' id='toggle-dateformat' class='setting-toggle'>Show options for date formatting</a>\n<div id='description-dateformat' style='display:none'><div><strong>a</strong>&nbsp;&nbsp;'a.m.' or 'p.m.' (Note that this is slightly different than PHP's output, because this includes periods to match Associated Press style.)</div>\n<div><strong>A</strong>&nbsp;&nbsp;'AM' or 'PM'.</div>\n<div><strong>b</strong>&nbsp;&nbsp;Month, textual, 3 letters, lowercase.</div>\n<div><strong>B</strong>&nbsp;&nbsp;Not implemented.</div>\n<div><strong>c</strong>&nbsp;&nbsp;ISO 8601 Format.</div>\n<div><strong>d</strong>&nbsp;&nbsp;Day of the month, 2 digits with leading zeros.</div>\n<div><strong>D</strong>&nbsp;&nbsp;Day of the week, textual, 3 letters.</div>\n<div><strong>f</strong>&nbsp;&nbsp;Time, in 12-hour hours and minutes, with minutes left off if they're zero. Proprietary extension.</div>\n<div><strong>F</strong>&nbsp;&nbsp;Month, textual, long.</div>\n<div><strong>g</strong>&nbsp;&nbsp;Hour, 12-hour format without leading zeros.</div>\n<div><strong>G</strong>&nbsp;&nbsp;Hour, 24-hour format without leading zeros.</div>\n<div><strong>h</strong>&nbsp;&nbsp;Hour, 12-hour format.</div>\n<div><strong>H</strong>&nbsp;&nbsp;Hour, 24-hour format.</div>\n<div><strong>i</strong>&nbsp;&nbsp;Minutes.</div>\n<div><strong>I</strong>&nbsp;&nbsp;Not implemented.</div>\n<div><strong>j</strong>&nbsp;&nbsp;Day of the month without leading zeros.</div>\n<div><strong>l</strong>&nbsp;&nbsp;Day of the week, textual, long.</div>\n<div><strong>L</strong>&nbsp;&nbsp;Boolean for whether it's a leap year.</div>\n<div><strong>m</strong>&nbsp;&nbsp;Month, 2 digits with leading zeros.</div>\n<div><strong>M</strong>&nbsp;&nbsp;Month, textual, 3 letters.</div>\n<div><strong>n</strong>&nbsp;&nbsp;Month without leading zeros.</div>\n<div><strong>N</strong>&nbsp;&nbsp;Month abbreviation in Associated Press style. Proprietary extension.</div>\n<div><strong>O</strong>&nbsp;&