COPY tendenci_guide_guide (id, "position", title, slug, content, section) FROM stdin;
1	1	Getting Started with Tendenci	getting-started-with-tendenci	<p>Tendenci is a complex yet easy-to-use software package that powers web sites around the world! You can use as much or as little of the software as you need to build and manage a website for your organization.</p>\n\n<p>This short overview will take you through the basics you need to know in order to set up and manage the content on your site.</p>	Getting Started
2	2	The Dashboard	the-dashboard	<p>The Dashboard is command central for your site. You can <a title="Dashboard" href="/dashboard/" target="_blank">bring up the Dashboard</a> at any time by clicking the Tendenci icon in the top left corner of your screen. (You must be logged in to see the icon.)</p>\n<p><img style="display: block; margin-left: auto; margin-right: auto;" title="tendenci-toolbar.png" src="http://media.tendenciapp.com/images/tendenci_guide/tendenci-toolbar.png" alt="tendenci-toolbar.png" width="400"></p>\n \n<h3>Icons</h3>\n<p>Each icon on the Dashboard represents a module that controls data or settings for your site.</p>\n<p><img style="display: block; margin-left: auto; margin-right: auto;" title="tendenci-dashboard.png" src="http://media.tendenciapp.com/images/tendenci_guide/tendenci-dashboard.png" alt="tendenci-dashboard.png" width="400"></p>\n<p>For example, if you click <strong><span style="color: #0000ff;">Users</span></strong>, you will have the option to:</p>\n<ul>\n<li><strong><span style="color: #0000ff;">Search </span></strong>your User database, </li>\n<li><strong><span style="color: #0000ff;">Add </span></strong>new Users, </li>\n<li><strong><span style="color: #0000ff;">Edit </span></strong>User records and reset passwords, and </li>\n<li>Control site reflexes associated with your Users, such as whether or not New Users are&nbsp;automatically&nbsp;signed up for your newsletter.&nbsp;</li>\n</ul>\n \n<h3>Dashboard Admin Menu</h3>\n<p>Take a moment to run your mouse over the navigation bar at the top of your screen.&nbsp;<br>&nbsp;<img style="display: block; margin-left: auto; margin-right: auto;" title="Admin-menu.JPG" src="http://media.tendenciapp.com/images/tendenci_guide/dashboard-admin-menu.png" alt="Admin-menu.JPG" width="261"><br>As an alternative to using the Dashboard icons, you will find quick access to all of the things you will manage as site administrator.&nbsp;</p>\n \n<h3>Tech Support</h3>\n<p>And don't miss the links to "Search Helpfiles" and "E-mail Support" in the <span style="color: #0000ff;"><strong>Admin&gt;Support</strong></span> menu.&nbsp;</p>\n<p><img style="display: block; margin-left: auto; margin-right: auto;" title="support-menu.JPG" src="http://media.tendenciapp.com/images/tendenci_guide/tendenci-support-menu.png" alt="support-menu.JPG" width="198"></p>\n<p>The <a href="http://tendenci.com/help-files/">Tendenci help files</a> are a great way to find answers to specific questions about using Tendenci. If you can't find an answer there, <a title="Contact our support team!" href="mailto:support@ams365.cn">contact our Support team!</a></p>	Getting Started
3	3	Adding Site Content	adding-site-content	<p>Keeping your site content fresh is the best way to keep people coming back!</p>\n<p>Content takes on many different forms:</p>\n<ul>\n<li>Pages</li>\n<li>Articles and News</li>\n<li>Stories</li>\n<li>Events</li>\n<li>Photo Albums</li>\n<li>And more!</li>\n</ul>\n<p>Adding content in Tendenci is very simple. Just click the icon and go. (Or use the navigation link at the top of the screen for quick access.) Let's look at some examples.</p>\n<p><img style="margin-left : 5px;" title="add-page.png" src="http://media.tendenciapp.com/images/tendenci_guide/add-page.png" alt="add-page.png" width="300" align="left"></p>\n<h3><strong>Pages</strong></h3>\n<p><a title="Tendenci Help Files : Pages" href="http://tendenci.com/help-files/topic/96/" target="_blank">Pages </a>are simply that - web <em>pages </em>that live on your web <em>site</em>. Pages on your site will include things like "AboutUs" and "Benefits of Membership".</p>\n<p>To add a page, simply click the <strong><span style="color: #0000ff;">Pages </span></strong>icon and click <strong><span style="color: #0000ff;">Add </span></strong>- or choose<strong><span style="color: #0000ff;"> Content &gt; Pages &gt; Add</span></strong> from the menu along the top. (<a title="Pages Add" href="/pages/add/" target="_blank">Click here to add a page.</a>)</p>\n<p>Enter a page <span style="color: #0000ff;"><strong>Title </strong></span>and <span style="color: #0000ff;"><strong>Content</strong></span>. Note the friendly content editor that lets you format your text as if you were using a common word processing program! You can also insert images or other media files, such as video or sound clips, to add excitement to your page!</p>\n<p>Note also the&nbsp;<strong><span style="color: #0000ff;">URL Path</span></strong>&nbsp;that is defaulted in based on the title. You will use this to reference this page later when you are editing your site navigation.</p>\n<p><em><strong>"I need a minute to figure out what to write on my page."</strong></em></p>\n<p>First draft not your best work? We get that. In Tendenci, you have the option to uncheck the <strong><span style="color: #0000ff;">Active </span></strong>box if you are not ready for the page to be visible to the public.</p>\n<p>To reaccess and edit this page in the future, click the <strong><span style="color: #0000ff;">Pages </span></strong>icon in the Dashboard and click <strong><span style="color: #0000ff;">Edit</span></strong>.</p>\n<p><strong>Tada! You are building your site!!</strong></p>\n<h3><strong>Articles and News</strong></h3>\n<p>Most of the latest and greatest from your group will show up in <a title="Tendenci Help Files: Articles module" href="http://tendenci.com/help-files/topic/4/" target="_blank">Articles and News</a>. (or your Blog!)</p>\n<p><img style="float: left;" title="articles-icon.png" src="http://media.tendenciapp.com/images/tendenci_guide/articles-icon.png" alt="articles-icon.png" width="75">Post your article or news story using a very similar interface as with Pages. <a title="Articles Add" href="/articles/add/" target="_blank">Click here to add an article.</a></p>\n<p>When a site visitor clicks on "<atitle="Articles List"href="/articles/search/"target="_blank">Read our Latest News</a>", they will see a list of your Articles or News stories. You may also display a few of the most recent Articles on the home page of your site.</p>\n<h3><strong>Stories</strong></h3>\n<p><a title="Tendenci Help Files: Storiesmodule" href="http://tendenci.com/help-files/topic/92/" target="_blank">Stories</a>&nbsp;refer to articles outside of your organization that you want to highlight on your site.</p>\n<p><img style="float: right;margin-left : 5px;" title="Stories-search.png" src="http://media.tendenciapp.com/images/tendenci_guide/Stories-search.png" alt="Stories-search.png" width="200" align="right">For example, if you see an in-industry story on another web site that would be of interest to your people, you can add a reference and photo to your site that points back to the original source. It is a great way to share links with another organization and continually provide fresh and relevant content for your users!</p>\n<p><a title="Stories Add" href="/stories/add/" target="_blank">Click here to add a story.</a> Read on to learn about getting stories and articles to show up on the home page of your site!</p>\n	Getting Started
4	4	Homepage Content and Tags	homepage-content-and-tags	<p>Now that you are comfortable with adding content, let's look at some ways to use that content creatively.</p>\n<h3><strong>Displaying Content on the Home Page</strong></h3>\n<p>The site template selected may display some of your content on the home page of your site. If you have an <strong>Events </strong>block on the home page - or maybe an <strong>Articles </strong>block - these items will automatically display as they are entered.</p>\n<p><img title="event-display-homepage.png" src="http://media.tendenciapp.com/images/tendenci_guide/event-display-homepage.png" alt="event-display-homepage.png" width="400"></p>\n<p>Other types of content will use <strong>Tags </strong>to determine what displays on the home page.</p>\n<h3><strong>Using Tags</strong></h3>\n<p>When adding content, you will often see a <strong>Tags </strong>field. <strong><a title="TendenciHelpFiles : Tags" href="http://tendenci.com/help-files/topic/60/" target="_blank">Tags </a></strong>are used to pull various types of content to the Home Page of your website. In the following layout, the central image of the koala is a photo associated with a story titled Community Day at the Zoo.&nbsp;</p>\n<p><img title="story-display-homepage.png" src="http://media.tendenciapp.com/images/tendenci_guide/story-display-homepage.png" alt="story-display-homepage.png" width="400"></p>\n<p>Note the four parts to the story: <strong>image, title, summary, </strong>and <strong>link to read more</strong>. (<a title="StoriesAdd" href="/stories/add/" target="_blank">Click here to pull up the Add Story screen.</a>) In order to get this story to appear in the <strong>Rotator </strong>section of the site template, the word <strong>rotator</strong> is put in the <strong>Tags</strong> field for this story when adding.</p>\n<p><img title="Rotator-tag.png" src="http://media.tendenciapp.com/images/tendenci_guide/Rotator-tag.png" alt="Rotator-tag.png" width="396"></p>\n<p>You can designate multiple stories with the "rotator" tag and your home page will rotate through all designated stories. Most sites have 3-5 stories targeted for rotation.</p>\n<p>Other sections of your template will use different tags to display the story in different places with different formatting. Look for the <strong>tag label</strong> as you roll over each portion of the page.</p>\n\n	Getting Started
5	5	Calendar Events	calendar-events	<p><a title="Tendenci Help Files: Calendar Events" href="http://tendenci.com/help-files/topic/2/" target="_blank">Events</a> are a great source of knowledge transfer, networking and income for your organization! Use your site to <strong>build excitement</strong> through promotion, sharing of details and early registration pricing!&nbsp;</p>\n<h3>Adding Events</h3>\n<p>When adding Events in Tendenci, you will be able to:<img style="float: right;margin-left: 5px;" title="event-pricing.png" src="http://media.tendenciapp.com/images/tendenci_guide/event-pricing.png" alt="event-pricing.png" width="200"></p>\n<ul>\n<li>Add complete event details</li>\n<li>Include speaker info and images</li>\n<li>Accept multiple payment types, including online payment (<a title="Tendenci Help Files: MerchantAccount" href="http://tendenci.com/help-files/topic/89/">requires vendor account set up</a>)</li>\n<li>Set multiple pricing tiers</li>\n</ul>\n<p>(<a title="Events Add" href="/events/add/" target="_blank">Click here to add an event.</a>)</p>\n<h3>Event Calendar Display</h3>\n<p>Use <a title="Tendenci Help Files: Event Types" href="http://tendenci.com/help-files/what-are-event-types/" target="_blank">Event Types</a> to color-code events for display on the site calendar. This is a quick way for your site visitors to separate meetings from deadlines, luncheons from galas!</p>\n<p><img title="calendar-events.png" src="http://media.tendenciapp.com/images/tendenci_guide/calendar-events.png" alt="calendar-events.png" width="400"></p>\n<h3>Event List on the Home Page</h3>\n<p><img style="float: left;margin-right: 5px;" title="upcoming-events.png" src="http://media.tendenciapp.com/images/tendenci_guide/upcoming-events.png" alt="upcoming-events.png" width="200">Remember, your site template may display the next event automatically on your home page. Some templates will list the next three. Check out your home page to see how you are promoting your events!</p>\n<h3>Event Management</h3>\n<p>As the event approaches, you will use the flexibility of Tendenci to smoothly carry out all the last minute details. You can quickly:</p>\n<ul>\n<li><a title="Tendenci Help Files: Adding a Registration" href="http://tendenci.com/help-files/adding-a-phonemail-in-registration/" target="_blank">Add phone-in registrations</a> to the event</li>\n<li><a title="Tendenci Help Files: Canceling a Registration" href="http://tendenci.com/help-files/cancelling-an-attendees-registration/" target="_blank">Cancel registrations</a> if needed</li>\n<li>Send reminders or program changes to registrants</li>\n<li>Print a roster of attendees, including paid/unpaid status, to use at the check-in table!</li>\n</ul>\n<p>What better way to promote this month's event than to show photos of your last awesome event?? Read on to learn how to add photos to your site!</p>	Getting Started
6	6	Photo Albums	photo-albums	<p>What's the first thing people look for after a great event? <strong>Photos!</strong> <a title="Tendenci Help Files: Photo Albums" href="http://tendenci.com/help-files/topic/1/" target="_blank">Photo albums</a> are a great way to keep the fire going after an event and encourage more registrants for the next one.</p>\n<p><strong>Adding photos to your site is super easy!!</strong></p>\n<p><strong><br></strong></p>\n<p><img style="float: left;margin-left: 5px;" title="photo-set-add.png" src="http://media.tendenciapp.com/images/tendenci_guide/photo-set-add.png" alt="photo-set-add.png" width="200"></p>\n<h3>Add the set</h3>\n<p>First, create the set.&nbsp;For example, May Luncheon or Annual Holiday Party.&nbsp;You can always uncheck the <span style="color: #0000ff;"><strong>Active </strong></span>field while you build out the set.&nbsp;&nbsp;</p>\n<p><strong><span style="color: #0000ff;">Content &gt; Photo Sets &gt; Add </span></strong><span style="color: #0000ff;">or&nbsp;</span><a title="Photo Sets Add" href="/photos/set/add/" target="_blank">Click here to create a photo set.</a></p>\n<h3>Add the photos</h3>\n<p>Then select the photos to be uploaded to that set and add titles, captions and tags!</p>\n<p><img style="display: block;margin-left: auto;margin-right: auto;" title="photo-add.png" src="http://media.tendenciapp.com/images/tendenci_guide/photo-add.png" alt="photo-add.png" width="300"></p>\n<p>After the photos have been uploaded, you can organize them in whatever order you wish and choose one for the "cover". You can also bulk edit the photo information, such as adding or changing tags for all photos.</p>\n<h3>Why put photos here instead of on another photo sharing web site?</h3>\n<p>Because YOU want the traffic! Instead of letting someone else host your photos, put your photos on your own site. Then you can link them to all your communications and promotions! Give access to the photo upload module to all your volunteer photographers and they can do the work! Then LINK LINK LINK!!</p>\n<p>Now, how exactly are we going to link to all of this fabulous content? Read on to learn how to customize your site navigation!</p>	Getting Started
7	7	Site Navigation	site-navigation	<p>Your site came with a standard navigation bar based on the most common requests. As you customize your site, you may want to make changes to the <strong>Main Nav</strong> and add <strong>Sub Nav</strong> links.</p>\n<p>**NOTE: Custom sites may use a more complex navigation structure that cannot be edited using the steps below.**</p>\n\n<h3>Editing Your Nav</h3>\n<p>Hover over the navigation menu to see the link to <a href="/navs/edit/1/items/?next=/dashboard/" target="_blank">Edit Main Navigation</a>. (You must be logged in as Administrator to see the link.)</p>\n<p><img style="display: block; margin-left: auto; margin-right: auto;" title="main-nav-edit.JPG" src="http://media.tendenciapp.com/images/tendenci_guide/main-nav-edit.png" alt="main-nav-edit.JPG" width="400"></p>\n<p>(<a href="/navs/edit/1/items/?next=/dashboard/" target="_blank">Click here to edit your navigation</a>.)</p>\n<p>The screen for editing your nav is fairly intuitive.</p>\n\n<p><img style="display: block; margin-left: auto; margin-right: auto;" title="nav-edit-items.JPG" src="http://media.tendenciapp.com/images/tendenci_guide/nav-edit-items.png" alt="nav-edit-items.JPG" width="400">&nbsp;&nbsp;</p>\n<h3>Organizing Your Nav</h3>\n<p>Click and drag the items to reorder your nav.</p>\n<p>Use the arrows on the right to promote an item to the main nav or to demote an item to a subnav position.</p>\n<p>Click the <span style="color: #0000ff;"><strong>Save All Navigation Items</strong></span> button when finished.</p>\n\n<h3>Changing the Labels on Your Nav Items</h3>\n<p>If you want to change the wording of your nav items -- for instance, you might want to change "About Us" to say "Who We Are" -- simply hover over the nav item and click the <span style="color: #0000ff;"><strong>Edit </strong></span>link.</p>\n<p><img style="display: block; margin-left: auto; margin-right: auto;" title="main-nav-label.JPG" src="http://media.tendenciapp.com/images/tendenci_guide/main-nav-label.png" alt="main-nav-label.JPG" width="400"></p>\n<p>Hover over the label again and click <span style="color: #0000ff;"><strong>Collapse</strong></span> to save your change.</p>\n\n<h3>Adding Pages to the Nav</h3>\n<p>As you create new pages for your site, you will want to link them in your nav so people can find them. These pages will appear in the Pages List on the left side of the screen.</p>\n<p><img style="display: block; margin-left: auto; margin-right: auto;" title="pages-list.JPG" src="http://media.tendenciapp.com/images/tendenci_guide/pages-list.png" alt="pages-list.JPG" width="216" height="213"></p>\n<p>Simply click to select the pages to add to the nav. Then click the <span style="color: #0000ff;"><strong>Add Selected Pages to Main Navigation</strong></span> button. The pages will be added to the end of your nav. Click and drag to position them within your nav structure.</p>\n<p>If you've added a bunch of pages to your site, use the <span style="color: #0000ff;"><strong>Search </strong></span>field to quickly find the page you want to add.</p>\n<p><img style="display: block; margin-left: auto; margin-right: auto;" title="pages-search.JPG" src="http://media.tendenciapp.com/images/tendenci_guide/pages-search.png" alt="pages-search.JPG" width="204"></p>\n\n<h3>Adding Custom Pages to the Nav</h3>\n<p>Use this feature to add links to your site navigation that are not site pages added by you. Things such as an Article List or Jobs Database are "pages" that come with your software.</p>\n<p>To add these pages, you will need to know the exact URL used to access that page.</p>\n<p style="padding-left: 30px;">From the Admin nav, choose <span style="color: #0000ff;"><strong>Content&gt;Articles&gt;List</strong></span>. When the page displays in your browser, copy the part of the URL immediately following your domain name.</p>\n<p style="padding-left: 30px;"><img title="url-articles-search.JPG" src="http://media.tendenciapp.com/images/tendenci_guide/url-articles-search.png" alt="url-articles-search.JPG" width="337"></p>\n<p style="padding-left: 30px;">To link to this page, you will need <strong><span style="color: #0000ff;">/articles/search/</span></strong>.</p>\n<p style="padding-left: 30px;">Commit it to memory, write it down or better yet, open a new tab in your browser so you can quickly reference it.</p>\n<p>Click the&nbsp;<a id="add-custom"><span style="color: #0000ff;"><strong>Add a Custom Navigation Item</strong></span></a> link in your nav editor. This will pop a new edit window.</p>\n<p><img style="display: block; margin-left: auto; margin-right: auto;" title="custom-nav-item.JPG" src="http://media.tendenciapp.com/images/tendenci_guide/custom-nav-item.png" alt="custom-nav-item.JPG" width="400"></p>\n<p>Enter the URL portion copied above in the <span style="color: #0000ff;"><strong>URL </strong></span>field.&nbsp;Enter the name of the link in the <span style="color: #0000ff;"><strong>Label </strong></span>field.&nbsp;Hover over the generic label name and click <span style="color: #0000ff;"><strong>Collapse </strong></span>to save your changes.</p>\n<p>Click and drag or use the arrows to position the new item.</p>\n\n<h3>Linking to External Pages</h3>\n<p>You can also use this feature to link to pages outside of your site. For example, if you want to link to the national organization's site, add a custom nav link and use the full URL in the URL field.</p>\n<p><img style="display: block; margin-left: auto; margin-right: auto;" title="url-national.JPG" src="http://media.tendenciapp.com/images/tendenci_guide/url-national.png" alt="url-national.JPG" width="209"></p>\n\n<p>Remember that the Site Navigation is the primary tool your visitors will use to quickly find things on your site. Keep it simple and well-organized!</p>	Getting Started
8	8	Tips	tips	<p>Well, that about covers it! At this point, you should be able to add and modify most of the content on your site.</p>\n<p>Here are a few parting tips:</p>\n<ol>\n<li><strong>Keep your content fresh!</strong> Add new articles, photos and stories regularly. Or start a blog on the site! Encourage multiple members of your organization to publish content on the site.</li>\n<li><strong>Use photos! </strong>People love to see themselves on the site. This is a great way to show how much fun you had at your last event and encourage people to come to the next one!<br> <br> </li>\n<li><strong>Make money off your Jobs Listings!</strong> Encouraging companies to list job openings in your database is not only a great service for your members, but can be a bigger money maker too! (We didn't cover this one but you will find the interface very similar.)<br> <br> </li>\n<li><strong>Use the Help Files!</strong> Our users have built hundreds of help files on using Tendenci features, from very specific reflexes to addressing larger concepts. If you can't find it in the <a title="Tendenci Help Files" href="http://tendenci.com/help-files/" target="_blank">Tendenci Help Files</a>, <a title="Contact our Support Team!" href="mailto : support@tendenci.com">contact our Support Team</a>!</li>\n</ol>\n<h3>Ready to get started?? Let's <strong><a href="/dashboard">Go to the Dashboard!</a></strong></h3>\n	Getting Started
\.


