sp;</p>\\r\\n<p>At the time of renewal you can choose to renew all individuals who are part of your corporate membership.</p>\\r\\n<p>If you have any trouble with membership renewal or need access to be set up as a representative for your corporate/group membership, please <a href=\\"http://gra.tendenci.net/contact\\" target=\\"_blank\\" rel=\\"noopener\\">contact us</a></p>\\r\\n<p>&nbsp;</p>\\r\\n</div>", "template": "default.html", "owner_username": "system_generated", "allow_anonymous_view": true, "status": true, "design_notes": "", "tags": "", "status_detail": "active", "syndicate": true, "creator_username": "system_generated", "slug": "renewal", "contributor_type": 1, "allow_user_edit": false, "title": "Renewal", "allow_member_view": false, "allow_member_edit": false, "google_profile": "", "header_image": null}, "model": "pages.page", "pk": 16}	7b564c3d-2b31-11e8-830d-3c15c2d89ece	57	1
