61	2016-01-08 05:45:55.276+00	1	Corporate Membership	[{"field": "description", "old": "<p>Thank you for your interest in joining our organization!</p>\\r\\n<p>A corporate membership allows you to bulk purchase memberships for employees of your organization at a fixed rate.&nbsp;Each employee that signs up under your membership will have their own username and password to log into the site and access content.</p>\\r\\n<hr />\\r\\n<p><strong>The following steps will help guide you through the corporate membership application process:</strong></p>\\r\\n<p>1. Complete the corporate membership application on this page.</p>\\r\\n<p>2. Once your membership application is complete, register for your individual membership profile with the organization here <a href=\\"/memberships/applications/corp-pre-add\\" target=\\"_blank\\">Employee of Corporation/Organization application</a>.</p>\\r\\n<p>3. Send other employees of your organization here: <a href=\\"/memberships/applications/corp-pre-add\\" target=\\"_blank\\">Employee of Corporation/Organization application</a> to sign up as members under your corporate membership.</p>", "new": "<p>\\u611f\\u8c22\\u60a8\\u5bf9\\u52a0\\u5165\\u6211\\u4eec\\u7ec4\\u7ec7\\u7684\\u5174\\u8da3\\uff01</p>\\r\\n<p>\\u56e2\\u4f53\\u4f1a\\u5458\\u8d44\\u683c\\u5141\\u8bb8\\u60a8\\u4ee5\\u56fa\\u5b9a\\u8d39\\u7387\\u6279\\u91cf\\u8d2d\\u4e70\\u8d35\\u7ec4\\u7ec7\\u5458\\u5de5\\u7684\\u4f1a\\u5458\\u8d44\\u683c\\u3002\\u6839\\u636e\\u60a8\\u7684\\u4f1a\\u5458\\u8d44\\u683c\\u6ce8\\u518c\\u7684\\u6bcf\\u4f4d\\u5458\\u5de5\\u90fd\\u5c06\\u62e5\\u6709\\u81ea\\u5df1\\u7684\\u7528\\u6237\\u540d\\u548c\\u5bc6\\u7801\\uff0c\\u4ee5\\u767b\\u5f55\\u8be5\\u7f51\\u7ad9\\u5e76\\u8bbf\\u95ee\\u5185\\u5bb9\\u3002</p>\\r\\n<hr />\\r\\n<p><strong>\\u4ee5\\u4e0b\\u6b65\\u9aa4\\u5c06\\u6709\\u52a9\\u4e8e\\u6307\\u5bfc\\u60a8\\u5b8c\\u6210\\u56e2\\u4f53\\u4f1a\\u5458\\u7533\\u8bf7\\u6d41\\u7a0b\\uff1a:</strong></p>\\r\\n<p>1. \\u5728\\u6b64\\u9875\\u9762\\u4e0a\\u5b8c\\u6210\\u4f01\\u4e1a\\u4f1a\\u5458\\u7533\\u8bf7\\u3002</p>\\r\\n<p>2.&nbsp;\\u4e00\\u65e6\\u60a8\\u7684\\u4f1a\\u5458\\u7533\\u8bf7\\u5b8c\\u6210\\uff0c\\u8bf7<a href=\\"/memberships/applications/corp-pre-add\\">\\u70b9\\u51fb\\u6ce8\\u518c</a>\\u60a8\\u7684\\u4e2a\\u4eba\\u4f1a\\u5458\\u8d44\\u6599&nbsp;</p>\\r\\n<p>3.&nbsp;<a href=\\"/memberships/applications/corp-pre-add\\">\\u70b9\\u51fb\\u52a0\\u5165</a>\\u7ec4\\u7ec7\\u7684\\u5176\\u5b83\\u6210\\u5458</p>"}, {"field": "confirmation_text", "old": "<p>Thank you for your application.</p>\\r\\n<p>Please direct employees of your organization to the <a href=\\"/memberships/applications/corp-pre-add\\" target=\\"_blank\\">Employee of Corporation/Organization application</a>&nbsp;to register as a member once your membership has been approved.</p>\\r\\n<p>You will need to join using the link above if you wish to be included as a member.</p>", "new": "<p>\\u611f\\u8c22\\u60a8\\u7684\\u7533\\u8bf7\\u3002</p>\\r\\n<p>\\u5f53\\u4f60\\u7684\\u56e2\\u4f53\\u4f1a\\u5458\\u83b7\\u5f97\\u6279\\u51c6\\uff0c\\u8bf7\\u6307\\u5bfc\\u4f60\\u7684\\u7ec4\\u7ec7\\u7684\\u5458\\u5de5\\u53bb<a href=\\"/memberships/applications/corp-pre-add\\">\\u8fd9\\u4e2a\\u5730\\u5740</a>\\u5b8c\\u6210\\u6ce8\\u518c\\u52a0\\u5165\\u5230\\u4f01\\u4e1a\\u4e2d\\u3002</p>\\r\\n<p>&nbsp;</p>"}]	{"fields": {"creator": null, "authentication_method": "email", "allow_user_view": true, "entity": 1, "owner": null, "guid": "43d0bd26-677d-11e5-aebb-0242ac110085", "create_dt": "2015-09-30T09:12:21.100", "update_dt": "2016-01-08T13:45:55.276", "confirmation_text": "<p>Thank you for your application.</p>\\r\\n<p>Please direct employees of your organization to the <a href=\\"/memberships/applications/corp-pre-add\\" target=\\"_blank\\">Employee of Corporation/Organization application</a>&nbsp;to register as a member once your membership has been approved.</p>\\r\\n<p>You will need to join using the link above if you wish to be included as a member.</p>", "include_